import Heading from "./Heading";
import { Link } from "react-router-dom";
import smallLogo from "../../images/logo-single-houses.svg";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

export default function Footer() {
  return (
    <footer>
      <Row className="footer-container">
        <Col className="footer-container__list">
          <Heading content="More info" size="4" />
          <Link to="/accommodations">Accommodations</Link>

        </Col>
        <Col>
          <Heading content="Useful Links" size="4" />
        </Col>
        <Col>
          <img src="smallLogo" alt=" Small logo Holidaze" />
        </Col>
        <Col>
          <Heading content="Our Office" size="4" />
        </Col>
        <Col>
          <Heading content="Follow" size="4" />
        </Col>
      </Row>
    </footer>
  )
};
